While any type in Rust can be exposed as a GraphQL object , the most common one is a struct : # extern crate juniper;
# use juniper::GraphQLObject;
#
#[derive(GraphQLObject)]
struct Person { name: String, age: i32,
}
#
# fn main() {} This creates a GraphQL object type called Person, with two fields: name of type String!, and age of type Int!. Because of Rust 's type system, everything is exported as non-null by default. TIP : If a nullable field is required, the most obvious way is to use Option. Or Nullable for distinguishing between explicit and implicit nulls .

