By default, struct fields are converted from Rust 's standard snake_case naming convention into GraphQL 's camelCase convention: # extern crate juniper;
# use juniper::GraphQLObject;
#
#[derive(GraphQLObject)]
struct Person { first_name: String, // exposed as `firstName` in GraphQL schema last_name: String, // exposed as `lastName` in GraphQL schema
}
#
# fn main() {} We can override the name by using the #[graphql(name = "...")] attribute: # extern crate juniper;
# use juniper::GraphQLObject;
#
#[derive(GraphQLObject)]
#[graphql(name = "WebPerson")] // now exposed as `WebPerson` in GraphQL schema
struct Person { name: String, age: i32, #[graphql(name = "websiteURL")] website_url: Option<String>, // now exposed as `websiteURL` in GraphQL schema
}
#
# fn main() {} Or provide a different renaming policy for all the struct fields: # extern crate juniper;
# use juniper::GraphQLObject;
#
#[derive(GraphQLObject)]
#[graphql(rename_all = "none")] // disables any renaming
struct Person { name: String, age: i32, website_url: Option<String>, // exposed as `website_url` in GraphQL schema
}
#
# fn main() {} TIP : Supported policies are: SCREAMING_SNAKE_CASE, camelCase and none (disables any renaming).

