Using a plain Rust struct for representing a GraphQL object is easy and trivial but does not cover every case. What if we need to express something non-trivial as a GraphQL field , such as: Calling non-trivial logic while executing the field (like querying database, etc.). Accepting field arguments . Defining a circular GraphQL object , where one of its fields returns the type itself. Using some other (non- struct ) Rust type to represent a GraphQL object . To support these more complicated use cases, we need a way to define a GraphQL field as a function. In Juniper this is achievable by placing the #[graphql_object] attribute on an impl block , which turns its methods into GraphQL fields : # extern crate juniper;
# use juniper::{GraphQLObject, graphql_object};
#
#[derive(GraphQLObject)]
struct Person { name: String, age: i32,
} struct House { inhabitants: Vec<Person>,
} // Defines the `House` GraphQL object.
#[graphql_object]
impl House { // Creates the field `inhabitantWithName(name: String!)`, // returning a `null`able `Person`. fn inhabitant_with_name(&self, name: String) -> Option<&Person> { self.inhabitants.iter().find(|p| p.name == name) }
}
#
# fn main() {} NOTE : To access global data such as database connections or authentication information, a context is used. To learn more about this, see the "Context" chapter .

