Though Rust doesn't have the notion of default arguments, GraphQL arguments are able to have default values. These default values are used when a GraphQL operation doesn't specify the argument explicitly. In Juniper , defining a default value for a GraphQL argument is enabled by the #[graphql(default)] attribute: # extern crate juniper;
# use juniper::graphql_object;
#
struct Person; #[graphql_object]
impl Person { fn field1( // Default value can be any valid Rust expression, including a function // call, etc. #[graphql(default = true)] arg1: bool, // If default expression is not specified, then the `Default::default()` // value is used. #[graphql(default)] arg2: i32, ) -> String { format!("{arg1} {arg2}") }
}
#
# fn main() {}

