Context cannot be a mutable reference as fields may be resolved concurrently. If something in the context requires a mutable reference, the context type should leverage the interior mutability pattern (e.g. use RwLock, RefCell or similar). For example, when using async runtime with work stealing (like tokio ), which obviously requires thread safety in addition, we will need to use a corresponding async version of RwLock: # extern crate juniper;
# extern crate tokio;
# use std::collections::HashMap;
# use juniper::graphql_object;
use tokio::sync::RwLock; struct Database { requested_count: HashMap<i32, i32>,
} // Since we cannot directly implement `juniper::Context`
// for `RwLock`, we use the newtype idiom.
struct DatabaseContext(RwLock<Database>); impl juniper::Context for DatabaseContext {} struct User { id: i32, name: String
} #[graphql_object]
#[graphql(context = DatabaseContext)]
impl User { async fn times_requested<'db>(&self, ctx: &'db DatabaseContext) -> i32 { // Acquire a mutable reference and `.await` if async `RwLock` is used, // which is necessary if context consists of async operations like // querying remote databases. // Obtain base type. let DatabaseContext(db) = ctx; // If context is immutable use `.read()` on `RwLock` instead. let mut db = db.write().await; // Perform a mutable operation. db.requested_count .entry(self.id) .and_modify(|e| *e += 1) .or_insert(1) .clone() } fn name(&self) -> &str { self.name.as_str() } fn id(&self) -> i32 { self.id }
}
#
# fn main() {} TIP : Replace tokio::sync::RwLock with std::sync::RwLock (or similar) if you don't intend to use async resolving.

