Sometimes it's desirable to return additional structured error information to clients. This can be accomplished by implementing the IntoFieldError trait : # #[macro_use] extern crate juniper;
# use juniper::{FieldError, IntoFieldError, ScalarValue, graphql_object};
#
enum CustomError { WhateverNotSet,
} impl<S: ScalarValue> IntoFieldError<S> for CustomError { fn into_field_error(self) -> FieldError<S> { match self { Self::WhateverNotSet => FieldError::new( "Whatever does not exist", graphql_value!({ "type": "NO_WHATEVER" }), ), } }
} struct Example { whatever: Option<bool>,
} #[graphql_object]
impl Example { fn whatever(&self) -> Result<bool, CustomError> { if let Some(value) = self.whatever { return Ok(value); } Err(CustomError::WhateverNotSet) }
}
#
# fn main() {} And the specified structured error information will be included into the error's extensions : { "errors": [{ "message": "Whatever does not exist", "locations": [{"line": 2, "column": 4}], "extensions": { "type": "NO_WHATEVER" } }]
} NOTE : This pattern is particularly useful when it comes to instrumentation of returned field errors with custom error codes or additional diagnostics (like stack traces or tracing IDs).

