In this example, basic input validation is implemented with GraphQL types . Strings are used to identify the problematic field name. Errors for a particular field are also returned as a string . # extern crate juniper;
# use juniper::{GraphQLObject, GraphQLUnion, graphql_object};
#
#[derive(GraphQLObject)]
pub struct Item { name: String, quantity: i32,
} #[derive(GraphQLObject)]
pub struct ValidationError { field: String, message: String,
} #[derive(GraphQLObject)]
pub struct ValidationErrors { errors: Vec<ValidationError>,
} #[derive(GraphQLUnion)]
pub enum GraphQLResult { Ok(Item), Err(ValidationErrors),
} pub struct Mutation; #[graphql_object]
impl Mutation { fn add_item(&self, name: String, quantity: i32) -> GraphQLResult { let mut errors = Vec::new(); if !(10 <= name.len() && name.len() <= 100) { errors.push(ValidationError { field: "name".into(), message: "between 10 and 100".into(), }); } if !(1 <= quantity && quantity <= 10) { errors.push(ValidationError { field: "quantity".into(), message: "between 1 and 10".into(), }); } if errors.is_empty() { GraphQLResult::Ok(Item { name, quantity }) } else { GraphQLResult::Err(ValidationErrors { errors }) } }
}
#
# fn main() {} Each function may have a different return type and depending on the input parameters a new result type may be required. For example, adding a User would require a new result type containing the variant Ok(User)instead of Ok(Item). NOTE : In this example the returned string contains a server-side localized error message. However, it is also possible to return a unique string identifier and have the client present a localized string to its users. The client can send a mutation request and handle the resulting errors in the following manner: { mutation { addItem(name: "", quantity: 0) { ... on Item { name } ... on ValidationErrors { errors { field message } } } }
} NOTE : A useful side effect of this approach is to have partially successful queries or mutations. If one resolver fails, the results of the successful resolvers are not discarded.

