Instead of using strings to propagate errors, it is possible to use GraphQL type system to describe the errors more precisely. For each fallible input argument we create a field in a GraphQL object . The field is set if the validation for that particular argument fails. # extern crate juniper;
# use juniper::{GraphQLObject, GraphQLUnion, graphql_object};
#
#[derive(GraphQLObject)]
pub struct Item { name: String, quantity: i32,
} #[derive(GraphQLObject)]
pub struct ValidationError { name: Option<String>, quantity: Option<String>,
} #[derive(GraphQLUnion)]
pub enum GraphQLResult { Ok(Item), Err(ValidationError),
} pub struct Mutation; #[graphql_object]
impl Mutation { fn add_item(&self, name: String, quantity: i32) -> GraphQLResult { let mut error = ValidationError { name: None, quantity: None, }; if !(10 <= name.len() && name.len() <= 100) { error.name = Some("between 10 and 100".into()); } if !(1 <= quantity && quantity <= 10) { error.quantity = Some("between 1 and 10".into()); } if error.name.is_none() && error.quantity.is_none() { GraphQLResult::Ok(Item { name, quantity }) } else { GraphQLResult::Err(error) } }
}
#
# fn main() {} NOTE : We will likely want some kind of code generation to reduce repetition as the number of types required is significantly larger than before. Each resolver function has a custom ValidationResult which contains only fields provided by the function. So, all the expected errors are handled directly inside the query. Additionally, all non-critical errors are known in advance by both the server and the client: { mutation { addItem { ... on Item { name } ... on ValidationErrorsItem { name quantity } } }
}

