Our examples so far have only included non-critical errors. Providing errors inside a GraphQL schema still allows us to return unexpected critical errors when they occur. In the following example, a theoretical database could fail and would generate errors. Since it is not common for a database to fail, the corresponding error is returned as a critical error : # extern crate juniper;
# use juniper::{FieldError, GraphQLObject, GraphQLUnion, ScalarValue, graphql_object, graphql_value};
#
#[derive(GraphQLObject)]
pub struct Item { name: String, quantity: i32,
} #[derive(GraphQLObject)]
pub struct ValidationErrorItem { name: Option<String>, quantity: Option<String>,
} #[derive(GraphQLUnion)]
pub enum GraphQLResult { Ok(Item), Err(ValidationErrorItem),
} pub enum ApiError { Database,
} impl<S: ScalarValue> juniper::IntoFieldError<S> for ApiError { fn into_field_error(self) -> FieldError<S> { match self { Self::Database => FieldError::new( "Internal database error", graphql_value!({"type": "DATABASE"}), ), } }
} pub struct Mutation; #[graphql_object]
impl Mutation { fn add_item(&self, name: String, quantity: i32) -> Result<GraphQLResult, ApiError> { let mut error = ValidationErrorItem { name: None, quantity: None, }; if !(10 <= name.len() && name.len() <= 100) { error.name = Some("between 10 and 100".into()); } if !(1 <= quantity && quantity <= 10) { error.quantity = Some("between 1 and 10".into()); } if error.name.is_none() && error.quantity.is_none() { Ok(GraphQLResult::Ok(Item { name, quantity })) } else { Ok(GraphQLResult::Err(error)) } }
}
#
# fn main() {}

