Up until now, we've only looked at mapping structs to GraphQL objects . However, any Rust type can be exposed a GraphQL object . Using Result-like enums can be a useful way of reporting validation errors from a mutation: # extern crate juniper;
# use juniper::{GraphQLObject, graphql_object};
#
#[derive(GraphQLObject)] struct User { name: String,
} #[derive(GraphQLObject)]
struct ValidationError { field: String, message: String,
} enum SignUpResult { Ok(User), Error(Vec<ValidationError>),
} #[graphql_object]
impl SignUpResult { fn user(&self) -> Option<&User> { match self { Self::Ok(user) => Some(user), Self::Error(_) => None, } } fn error(&self) -> Option<&[ValidationError]> { match self { Self::Ok(_) => None, Self::Error(errs) => Some(errs.as_slice()) } }
}
#
# fn main() {} Here, we use an enum to decide whether a client's input data is valid or not, and it could be used as the result of e.g. a signUp mutation: { mutation { signUp(name: "wrong") { user { name } error { field message } } }
}

