GraphQL interfaces represent a list of named fields and their arguments . GraphQL objects and interfaces can then implement these interfaces which requires that the implementing type will define all fields defined by those interfaces . GraphQL interfaces map well to interfaces known from common object-oriented languages such as Java or C#, but Rust , unfortunately, has no concept that maps perfectly to them. The nearest analogue of GraphQL interfaces are Rust traits , but the main difference is that in GraphQL an interface type serves both as an abstraction and a boxed value (dispatchable to concrete implementers) , while in Rust , a trait is an abstraction only , and to represent such a boxed value a separate type is required , like a trait object or an enum consisting of implementer types, because Rust trait doesn't represent a type itself, and so, can have no values. Another notable difference is that GraphQL interfaces are more like structurally-typed contracts: they only declare a list of fields a GraphQL type should already have. Rust traits , on the other hand, are type classes , which don't really care about existing methods, but, rather, require to provide implementations for required methods despite the fact whether the type already has such methods or not. This difference makes the trait implementation not a good fit for expressing a GraphQL interface implementation, because we don't really need to implement any fields , the GraphQL type implementing a GraphQL interface has those fields already. We only need to check that fields' signatures match . That's why Juniper takes the following approach to represent GraphQL interfaces , which consists of two parts: Either a struct , or a trait (in case fields have arguments ), which acts only as a blueprint describing the required list of fields , and is not used in runtime at all. An auto-generated enum , representing a dispatchable value-type for the GraphQL interfaces , which may be referred and returned by other fields . This may be done by using either the #[graphql_interface] attribute or the #[derive(GraphQLInterface)] : # extern crate juniper;
# use juniper::{GraphQLInterface, GraphQLObject, graphql_interface};
#
// By default a `CharacterValue` enum is generated by macro to represent
// values of this GraphQL interface.
#[derive(GraphQLInterface)]
#[graphql(for = Human)] // enumerating all implementers is mandatory
struct Character { id: String,
} // Using a trait to describe the required fields is fine too. #[graphql_interface]
#[graphql(enum = HasHomeEnum, for = Human)]
// ^^^^ the generated value-type enum can be renamed, if required
trait HasHome { fn home_planet(&self) -> &str;
} #[derive(GraphQLObject)]
#[graphql(impl = [CharacterValue, HasHomeEnum])] // ^^^^^^^^^^^^^^ ^^^^^^^^^^^
// Notice the enum type names, neither the trait name nor the struct name
// is used to refer the GraphQL interface.
