GraphQL allows implementers (both objects and other interfaces ) to return "subtypes" instead of an original value. Basically, this allows to impose additional bounds on the implementation. Valid "subtypes" are: interface implementer instead of an interface itself: I implements T in place of a T; Vec<I implements T> in place of a Vec<T>. non-null value in place of a nullable: T in place of a Option<T>; Vec<T> in place of a Vec<Option<T>>. These rules are recursively applied, so Vec<Vec<I implements T>> is a valid "subtype" of a Option<Vec<Option<Vec<Option<T>>>>>. Also, GraphQL allows implementers to add nullable field arguments , which aren't present on an original interface. # extern crate juniper;
# use juniper::{graphql_interface, graphql_object, GraphQLInterface, ID};
#
#[derive(GraphQLInterface)]
#[graphql(for = [HumanValue, Luke])]
struct Node { id: ID,
} #[derive(GraphQLInterface)]
#[graphql(for = HumanConnectionValue)]
struct Connection { nodes: Vec<NodeValue>,
} #[derive(GraphQLInterface)]
#[graphql(impl = NodeValue, for = Luke)]
struct Human { id: ID, home_planet: String,
} #[derive(GraphQLInterface)]
#[graphql(impl = ConnectionValue)]
struct HumanConnection { nodes: Vec<HumanValue>, // ^^^^^^^^^^ notice not `NodeValue` // This can happen, because every `Human` is a `Node` too, so we just // impose additional bounds, which still can be resolved with // `... on Connection { nodes }` syntax.
} struct Luke { id: ID,
} #[graphql_object]
