Juniper follows a code-first approach to define a GraphQL schema. TIP : For a schema-first approach, consider using a juniper-from-schema crate for generating a juniper -based code from a schema file. GraphQL schema consists of three object types : a query root , a mutation root , and a subscription root . The query root operation type must be provided and must be an Object type. The mutation root operation type is optional; if it is not provided, the service does not support mutations. If it is provided, it must be an Object type. Similarly, the subscription root operation type is also optional; if it is not provided, the service does not support subscriptions. If it is provided, it must be an Object type. The query , mutation , and subscription root types must all be different types if provided. In Juniper , the RootNode type represents a schema . When the schema is first created, Juniper will traverse the entire object graph and register all types it can find. This means that if we define a GraphQL object somewhere but never use or reference it, it won't be exposed in a GraphQL schema . Both query and mutation objects are regular GraphQL objects , defined like any other object in Juniper . The mutation and subscription objects, however, are optional, since schemas can be read-only and do not require subscriptions . TIP : If mutation / subscription functionality is not needed, consider using the predefined EmptyMutation / EmptySubscription types for stubbing them in a RootNode . # extern crate juniper;
# use juniper::{
# EmptySubscription, FieldResult, GraphQLObject, RootNode, graphql_object,
# };
#
#[derive(GraphQLObject)] struct User { name: String,
} struct Query; #[graphql_object]
impl Query { fn user_with_username(username: String) -> FieldResult<Option<User>> { // Look up user in database...
# unimplemented!() }
} struct Mutation; #[graphql_object]
impl Mutation { fn sign_up_user(name: String, email: String) -> FieldResult<User> { // Validate inputs and save user in database...
# unimplemented!() }
} type Schema = RootNode<'static, Query, Mutation, EmptySubscription>;
#
# fn main() {} NOTE : It's considered a good practice to name query , mutation , and subscription root types as Query, Mutation, and Subscription respectively. The usage of subscriptions is a little different from the mutation and query objects , so they are discussed in the separate chapter .

