GraphQL subscriptions are a way to push data from a server to clients requesting real-time messages from a server. Subscriptions are similar to queries in that they specify a set of fields to be delivered to a client, but instead of immediately returning a single answer a result is sent every time a particular event happens on a server. In order to execute subscriptions in Juniper , we need a coordinator (spawning long-lived connections) and a GraphQL object with fields resolving into a Stream of elements which will then be returned to a client. The juniper_subscriptions crate provides a default implementation of these abstractions. The subscription root is just a GraphQL object , similar to the query root and mutations root that we define for operations in our GraphQL schema . For subscriptions all fields should be async and return a Stream of some GraphQL type values, rather than direct values. # extern crate futures;
# extern crate juniper;
# use std::pin::Pin;
# use futures::Stream;
# use juniper::{FieldError, graphql_object, graphql_subscription};
