# impl juniper::Context for Database {}
#
# pub struct Query;
#
# #[graphql_object]
# #[graphql(context = Database)]
# impl Query {
# fn hello_world() -> &'static str {
# "Hello World!"
# }
# }
#
type StringStream = Pin<Box<dyn Stream<Item = Result<String, FieldError>> + Send>>; pub struct Subscription; #[graphql_subscription]
#[graphql(context = Database)]
impl Subscription { // This subscription operation emits two values sequentially: // the `String`s "Hello" and "World!". async fn hello_world() -> StringStream { let stream = futures::stream::iter([ Ok(String::from("Hello")), Ok(String::from("World!")), ]); Box::pin(stream) }
}
#
# fn main () {}

