Disabling introspection in production is a widely debated topic, but we believe it’s one of the first things you can do to harden your GraphQL API in production. Some security requirements and considerations may mandate to disable GraphQL schema introspection in production environments. In Juniper this can be achieved by using the RootNode::disable_introspection() method: # extern crate juniper;
# use juniper::{
# EmptyMutation, EmptySubscription, GraphQLError, RootNode,
# graphql_object, graphql_vars,
# };
#
pub struct Query; #[graphql_object]
impl Query { fn some() -> bool { true }
} type Schema = RootNode<'static, Query, EmptyMutation, EmptySubscription>; fn main() { let schema = Schema::new(Query, EmptyMutation::new(), EmptySubscription::new()) .disable_introspection(); let query = "query { __schema { queryType { name } } }"; match juniper::execute_sync(query, None, &schema, &graphql_vars! {}, &()) { Err(GraphQLError::ValidationError(errs)) => { assert_eq!( errs.first().unwrap().message(), "GraphQL introspection is not allowed, but the operation contained `__schema`", ); } res => panic!("expected `ValidationError`, returned: {res:#?}"), }
} NOTE : Attempt to execute an introspection query results in validation error, rather than execution error.

