GraphQL has two semantically different ways to represent the lack of a value: Explicitly providing the literal value: null . Implicitly not providing a value at all. There are two ways that a client can submit a null value as an argument or a field in a GraphQL query: Either use an explicit null literal: { field(arg: null)
} Or simply omit the argument , so the implicit default null value kicks in: { field
} There are some situations where it's useful to know which one exactly has been provided. For example, let's say we have a function that allows users to perform a "patch" operation on themselves. Let's say our users can optionally have favorite and least favorite numbers, and the input for that might look like this: /// Updates user attributes. Fields that are [`None`] are left as-is.
struct UserPatch { /// If [`Some`], updates the user's favorite number. favorite_number: Option<Option<i32>>, /// If [`Some`], updates the user's least favorite number. least_favorite_number: Option<Option<i32>>,
}
#
# fn main() {} To set a user's favorite number to 7, we would set favorite_number to Some(Some(7)). In GraphQL , that might look like this: mutation { patchUser(patch: { favoriteNumber: 7 }) } To unset the user's favorite number, we would set favorite_number to Some(None). In GraphQL , that might look like this: mutation { patchUser(patch: { favoriteNumber: null }) } And if we want to leave the user's favorite number alone, just set it to None. In GraphQL , that might look like this: mutation { patchUser(patch: {}) } The last two cases rely on being able to distinguish between explicit and implicit null . Unfortunately, plain Option is not capable to distinguish them. That's why in Juniper , this can be done using the Nullable type: # extern crate juniper;
