struct UserPatchInput { favorite_number: Nullable<i32>, least_favorite_number: Nullable<i32>,
} impl From<UserPatchInput> for UserPatch { fn from(input: UserPatchInput) -> Self { Self { // The `explicit()` function transforms the `Nullable` into an // `Option<Option<T>>` as expected by the business logic layer. favorite_number: input.favorite_number.explicit(), least_favorite_number: input.least_favorite_number.explicit(), } }
} # struct UserPatch {
# favorite_number: Option<Option<i32>>,
# least_favorite_number: Option<Option<i32>>,
# }
#
# struct Session;
# impl Session {
# fn patch_user(&self, _patch: UserPatch) -> FieldResult<()> { Ok(()) }
# }
#
struct Context { session: Session,
}
impl juniper::Context for Context {} struct Mutation; #[graphql_object]
#[graphql(context = Context)]
impl Mutation { fn patch_user(patch: UserPatchInput, ctx: &Context) -> FieldResult<bool> { ctx.session.patch_user(patch.into())?; Ok(true) }
}
#
# fn main() {}

