DataLoader pattern, named after the correspondent dataloader NPM package , represents a mechanism of batching and caching data requests in a delayed manner for solving the N+1 problem . A port of the "Loader" API originally developed by @schrockn at Facebook in 2010 as a simplifying force to coalesce the sundry key-value store back-end APIs which existed at the time. At Facebook, "Loader" became one of the implementation details of the "Ent" framework, a privacy-aware data entity loading and caching layer within web server product code. This ultimately became the underpinning for Facebook's GraphQL server implementation and type definitions. In Rust ecosystem, DataLoader pattern is introduced with the dataloader crate , naturally usable with Juniper . Let's remake our example of N+1 problem , so it's solved by applying the DataLoader pattern: # extern crate anyhow;
# extern crate dataloader;
# extern crate juniper;
# use std::{collections::HashMap, sync::Arc};
# use anyhow::anyhow;
# use dataloader::non_cached::Loader;
# use juniper::{GraphQLObject, graphql_object};
#
# type CultId = i32;
# type UserId = i32;
#
# struct Repository;
#
# impl Repository {
# async fn load_cults_by_ids(&self, cult_ids: &[CultId]) -> anyhow::Result<HashMap<CultId, Cult>> { unimplemented!() }
# async fn load_all_persons(&self) -> anyhow::Result<Vec<Person>> { unimplemented!() }
# }
#
struct Context { repo: Repository, cult_loader: CultLoader,
} impl juniper::Context for Context {} #[derive(Clone, GraphQLObject)]
struct Cult { id: CultId, name: String,
} struct CultBatcher { repo: Repository,
} // Since `BatchFn` doesn't provide any notion of fallible loading, like // `try_load()` returning `Result<HashMap<K, V>, E>`, we handle possible
// errors as loaded values and unpack them later in the resolver.
impl dataloader::BatchFn<CultId, Result<Cult, Arc<anyhow::Error>>> for CultBatcher { async fn load( &mut self, cult_ids: &[CultId], ) -> HashMap<CultId, Result<Cult, Arc<anyhow::Error>>> { // Effectively performs the following SQL query: // SELECT id, name FROM cults WHERE id IN (${cult_id1}, ${cult_id2}, ...) match self.repo.load_cults_by_ids(cult_ids).await { Ok(found_cults) => { found_cults.into_iter().map(|(id, cult)| (id, Ok(cult))).collect() } // One could choose a different strategy to deal with fallible loads, // like consider values that failed to load as absent, or just panic. // See cksac/dataloader-rs#35 for details: // https://github.com/cksac/dataloader-rs/issues/35 Err(e) => { // Since `anyhow::Error` doesn't implement `Clone`, we have to // work around here. let e = Arc::new(e); cult_ids.iter().map(|k| (k.clone(), Err(e.clone()))).collect() } } }
} type CultLoader = Loader<CultId, Result<Cult, Arc<anyhow::Error>>, CultBatcher>; fn new_cult_loader(repo: Repository) -> CultLoader { CultLoader::new(CultBatcher { repo }) // Usually a `Loader` will coalesce all individual loads which occur // within a single frame of execution before calling a `BatchFn::load()` // with all the collected keys. However, sometimes this behavior is not // desirable or optimal (perhaps, a request is expected to be spread out // over a few subsequent ticks). // A larger yield count will allow more keys to be appended to the batch, // but will wait longer before the actual load. For more details see: // https://github.com/cksac/dataloader-rs/issues/12 // https://github.com/graphql/dataloader#batch-scheduling .with_yield_count(100)
} struct Person { id: UserId, name: String, cult_id: CultId,
} #[graphql_object]
