In backtracking algorithms, look ahead is the generic term for a subprocedure that attempts to foresee the effects of choosing a branching variable to evaluate one of its values. The two main aims of look-ahead are to choose a variable to evaluate next and to choose the order of values to assign to it. In GraphQL , look-ahead machinery allows us to introspect the currently executed GraphQL operation to see which fields has been actually selected by it. In Juniper , it's represented by the Executor::look_ahead() method. # extern crate juniper;
