Naturally, look-ahead machinery allows us to solve the N+1 problem by introspecting the requested fields and performing loading in batches eagerly, before actual resolving of those fields: # extern crate anyhow;
# extern crate juniper;
# use std::collections::HashMap;
# use anyhow::anyhow;
# use juniper::{graphql_object, Executor, GraphQLObject, ScalarValue};
#
# type CultId = i32;
# type UserId = i32;
#
# struct Repository;
#
# impl juniper::Context for Repository {}
#
# impl Repository {
# async fn load_cult_by_id(&self, cult_id: CultId) -> anyhow::Result<Option<Cult>> { unimplemented!() }
# async fn load_cults_by_ids(&self, cult_ids: &[CultId]) -> anyhow::Result<HashMap<CultId, Cult>> { unimplemented!() }
# async fn load_all_persons(&self) -> anyhow::Result<Vec<Person>> { unimplemented!() }
# }
# # enum Either<L, R> {
# Absent(L),
# Loaded(R), # }
#
#[derive(Clone, GraphQLObject)]
struct Cult { id: CultId, name: String,
} struct Person { id: UserId, name: String, cult: Either<CultId, Cult>,
} #[graphql_object]
#[graphql(context = Repository)]
impl Person { fn id(&self) -> CultId { self.id } fn name(&self) -> &str { self.name.as_str() } async fn cult(&self, #[graphql(ctx)] repo: &Repository) -> anyhow::Result<Cult> { match &self.cult { Either::Loaded(cult) => Ok(cult.clone()), Either::Absent(cult_id) => { // Effectively performs the following SQL query: // SELECT id, name FROM cults WHERE id = ${cult_id} LIMIT 1 repo.load_cult_by_id(*cult_id) .await? .ok_or_else(|| anyhow!("No cult exists for ID `{cult_id}`")) } } }
} struct Query; #[graphql_object]
#[graphql(context = Repository, scalar = S: ScalarValue)]
impl Query { async fn persons<S: ScalarValue>( #[graphql(ctx)] repo: &Repository, executor: &Executor<'_, '_, Repository, S>, ) -> anyhow::Result<Vec<Person>> { // Effectively performs the following SQL query: // SELECT id, name, cult_id FROM persons let mut persons = repo.load_all_persons().await?; // If the `Person.cult` field has been requested. if executor.look_ahead() .children() .iter() .any(|sel| sel.field_original_name() == "cult") { // Gather `Cult.id`s to load eagerly. let cult_ids = persons .iter() .filter_map(|p| { match &p.cult { Either::Absent(cult_id) => Some(*cult_id), // If for some reason a `Cult` is already loaded, // then just skip it. Either::Loaded(_) => None, } }) .collect::<Vec<_>>(); // Load the necessary `Cult`s eagerly. // Effectively performs the following SQL query: // SELECT id, name FROM cults WHERE id IN (${cult_id1}, ${cult_id2}, ...) let cults = repo.load_cults_by_ids(&cult_ids).await?; // Populate `persons` with the loaded `Cult`s, so they do not perform // any SQL queries on resolving. for p in &mut persons { let Either::Absent(cult_id) = &p.cult else { continue; }; p.cult = Either::Loaded( cults.get(cult_id) .ok_or_else(|| anyhow!("No cult exists for ID `{cult_id}`"))? .clone(), ); } } Ok(persons) }
} And so, performing a GraphQL query which lead to N+1 problem query { persons { id name cult { id name } }
} will lead to efficient SQL queries, just as expected: SELECT id, name, cult_id FROM persons;
SELECT id, name FROM cults WHERE id IN (1, 2, 3, 4);

