If you have a GraphQL type like this type User { id: Int! country: Country!
} You might create the corresponding Rust model type like this: struct User { id: i32, country_id: i32,
} However this approach has one big issue. How are you going to resolve the field User.country without doing a database query? All the resolver has access to is a User with a country_id field. It can't get the country without loading it from the database... Fundamentally these kinds of model structs don't work for eager loading with GraphQL. So this library takes a different approach. What if we created separate structs for the database models and the GraphQL models? Something like this: # fn main() {}
#
mod models { pub struct User { id: i32, country_id: i32 } pub struct Country { id: i32, }
} struct User { user: models::User, country: HasOne<Country>,
} struct Country { country: models::Country
} enum HasOne<T> { Loaded(T), NotLoaded,
} Now we're able to resolve the query with code like this: Load all the users (first query). Map the users to a list of country ids. Load all the countries with those ids (second query). Pair up the users with the country with the correct id, so change User.country from HasOne::NotLoaded to HasOne::Loaded(matching_country). When resolving the GraphQL field User.country simply return the loaded country.

