pub struct Query; impl QueryFields for Query { // The resolver for `Query.allUsers`. fn field_all_users( &self, executor: &Executor<'_, Context>, trail: &QueryTrail<'_, User, Walked>, ) -> FieldResult<Vec<User>> { let ctx = executor.context(); // Load the model users. let user_models = ctx.db.load_all_users(); // Turn the model users into GraphQL users. let mut users = User::from_db_models(&user_models); // Perform the eager loading. // `trail` is used to only eager load the fields that are requested. Because // we're using `QueryTrail`s from "juniper_from_schema" it would be a compile // error if we eager loaded associations that aren't requested in the query. User::eager_load_all_children_for_each(&mut users, &user_models, ctx, trail)?; Ok(users) }
